import React, { Component } from 'react';
import iconBarra from '../../images/iconbarra.png'
import user from '../../images/user.png'
import firebase from '../../firebaseConnection';

class Home extends Component {
    
    constructor(props){
        super(props);
        this.state = {
            
        }
    }

    render(){
        return(
            <div class="wrapper">	
                <header>
                    <div class="container">
                        <div class="header-data">
                            
                            <div class="logo">
                                <a href="index.html" title=""><img src={iconBarra}/></a>
                            </div> { /* logo end */ } 
                            
                            <div class="search-bar">
                                <form>
                                    <input type="text" name="search" placeholder="Pesquisar..."/>
                                    <button type="submit"><i class="fas fa-search"></i></button>
                                </form>
                            </div> { /* search-bar end */ }
                            
                            <div class="menu-btn">
                                <a href="#" title=""><i class="fa fa-bars"></i></a>
                            </div>  { /* menu-btn end */ } n
                            
                            <div class="user-account">
                                <div class="user-info">
                                    <img src={user}/>
                                    <a href="#" title="">@user</a>
                                    <i class="fas fa-chevron-circle-down"></i>
                                </div>
                                <div class="user-account-settingss" id="users">

                                    <h3>Meu Perfil</h3>
                                    <ul class="us-links">
                                        <li><a href="user-profile.html" title="">Meu perfil</a></li>
                                        
                                    </ul>

                                    
                                    <h3>Configurações</h3>
                                    <ul class="us-links">
                                        <li><a href="profile-account-setting.html" title="">Configurações da conta</a></li>
                                        <li><a href="#" title="">Privacidade</a></li>
                                        <li><a href="#" title="">Perguntas frequentes</a></li>
                                        <li><a href="#" title="">Termos e condições</a></li>
                                    </ul>
                                    <h3 class="tc"><a href="#" title="">Deslogar</a></h3>
                                </div> { /* user-account-settingss end */ }
                            </div>
                        </div>  { /* header-data end */ }
                    </div>
                </header> { /* header end */}	
        </div>
        )
    }

}

export default Home;
